import React from "react";
import { Task } from "./Task";

export const TaskList = ({ allTasks, handleDelete }) => {
  return (
    <ul id="taskList">
      {allTasks.map((item) => (
        <Task singleTask={item} handleDelete={handleDelete} />
      ))}
    </ul>
  );
};
